import React from 'react';
import {Card} from 'react-bootstrap';
import axios from 'axios';
const Home = () =>{

    const respuesta = axios.get('http://localhost:8000/api/Equipos/?format=json')
        .then((response) => {
            for (let index = 0; index < 17; index++) {     
                const respuesta = response.data[index];
                console.log();  
                var titulo = respuesta.Equipo;
                const cardInfo = [                     
                    {
                        image: "https://cdn5.dibujos.net/dibujos/pintados/201746/escudo-del-club-atletico-de-madrid-deportes-escudos-de-futbol-11197949.jpg",
                        title:Equipo,
                        text: "0€"
                    },
                ];
                const renderCard = (card, index) => {
                    return(
                        <React.Fragment>
                            <Card style={{width: "18rem"}}>
                                <Card.Img width="100" height="250" variant="top" src="holder.js/100px180" src={card.image}/>
                            </Card>
                            <Card.Body>
                                <Card.Title>{card.title}</Card.Title>
                                <Card.Text>{card.text}</Card.Text>
                            </Card.Body>
                        </React.Fragment>            
                    );
                }       
            
                return(
                    <section class="row mt-5 ml-5">
                        <div class="col-3">
                            {cardInfo.map(renderCard)}
                        </div>
                        <div class="col-3">
                            {cardInfo.map(renderCard)}
                        </div>
                        <div class="col-3">
                            {cardInfo.map(renderCard)}
                        </div>
                        <div class="col-3">
                            {cardInfo.map(renderCard)}
                        </div>
                    </section>
                );                                        
            }
        }); 
}

export default Home;
